import {

    faPlane,
} 
from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "../flightSearchBar/flightSearchBar.css";
import React, { useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

export const DealsList = ()=>{
    const [credentials, setCredentials] = useState({
        destination: undefined,
        min: 1,
        max:2,
    });
    
    return(

        <div class="flightSearchContainer">
           <div class="flightSearch">
            <div class="flightSearchItem">
                    <FontAwesomeIcon icon={faPlane} className="searchIcon" />   
                    <input type="text" placeholder="Where to?" className="searchInput" id="destination" name="destination"/>
            </div>
            <div class="flightSearchItem">
                <input type="number" placeholder="Min Price" className="searchInput" id="min" name="min"/>
            </div>
            <div class="flightSearchItem">
                <input type="number" placeholder="Max Price" className="searchInput" id="max" name="min"/>
            </div>
            <div className="flightSearchItem">
                    <button className="flight-buttom">
                    Search
                    </button>
                </div>
                </div>       
        </div>    
    );

}

export default DealsList
